import { useState } from "react";
import "./App.css";

function App() {
	const [seatSelected, setSeatSelected] = useState("");
	const [seats, setSeats] = useState([40]);

	return (
		<div className="container mx-auto px-4">
			{seats &&
				seats.map((item, index) => (
					<div className="space-y-4 mt-3">
						<div className="pointer-events-auto w-[21rem] rounded-lg bg-white p-4 text-[0.8125rem] leading-5 shadow-xl shadow-black/5 hover:bg-slate-50 ring-2 ring-indigo-600">
							<div className="flex justify-between">
								<div className="font-medium text-slate-900">Seat</div>
							</div>
							<div className="mt-6 font-medium text-slate-900">{item}</div>
						</div>
					</div>
				))}
		</div>
	);
}

export default App;
